import React from 'react';
import {
  Form, Input, Button,
} from 'antd';
import { MinusCircleOutlined, PlusOutlined } from '@ant-design/icons';

const AddAddressUser = () => (
  <Form layout = "horizontal" style = {{ flex : ` 0 0 50%`}}> 
    <Form.Item>
      <Form.List name="address">
        {(fields, { add, remove }) => (
          <div>
            {fields.map((field) => (
              <>
                <Form.Item
                  label="Address"
                  {...field}
                  name={[field.name, 'address']}
                  fieldKey={[field.fieldKey, 'address']}
                  rules={[
                    { required: true, message: 'Missing Address name' },
                  ]}
                >
                  <Input placeholder="Address" style={{ width: '80%' }} />
                  <MinusCircleOutlined
                    onClick={() => {
                      remove(field.name);
                    }}
                  />
                </Form.Item>
              </>
            ))}

            <Form.Item>
              <Button
                type="dashed"
                onClick={() => {
                  add();
                }}
                block
              >
                <PlusOutlined />
                {' '}
                Add Address
              </Button>
            </Form.Item>
          </div>
        )}
      </Form.List>
    </Form.Item>
  </Form>
);

export default AddAddressUser;
